neral\r\n\r\nEl sistema se basa en una arquitectura **microservicios** desacoplada, donde cada componente cumple una funci√≥n espec√≠fica y se comunica a trav√©s de HTTP/REST o eventos (Kafka).\r\n\r\n**Patrones utilizados:**\r\n- üß¨ API Gateway\r\n- üì¶ CQRS (Command Query Responsibility Segregation)\r\n- ‚öôÔ∏è Event-driven Design\r\n\r\n---\r\n\r\n## üß© Componentes y Tecnolog√≠as\r\n\r\n| Componente         | Descripci√≥n                          | Tecnolog√≠a / Lenguaje       |\r\n|--------------------|--------------------------------------|-----------------------------|\r\n| API Gateway        | Punto de entrada al sistema          | NGINX + Node.js             |\r\n| Servicio de Auth   | Manejo de tokens JWT y sesiones      | Express.js + Redis          |\r\n| Microservicio User | Gesti√≥n de usuarios                  | GoLang + PostgreSQL         |\r\n| Servicio ML        | Recomendaciones con IA               | Python (FastAPI) + TensorFlow|\r\n| Monitorizaci√≥n     | Logs y m√©tricas                      | Grafana + Prometheus        |\r\n\r\n---\r\n\r\n## üñá Diagrama del Sistema (Mermaid)\r\n\r\n```mermaid\r\ngraph TD\r\n    A[Cliente Web / M√≥vil] -->|HTTPS| B[API Gateway]\r\n    B --> C[Servicio de Autenticaci√≥n]\r\n    B --> D[Microservicio de Usuarios]\r\n    B --> E[Servicio de IA]\r\n    D --> F[(Base de Datos PostgreSQL)]\r\n    E --> G[(Modelo TensorFlow)]\r\n    C --> H[Redis]\r\n```\r\n\r\nüß¨ C√≥digo de Ejemplo\r\n\r\n```js\r\n// Ejemplo de endpoint en Node.js (Express)\r\napp.post(\'/login\', async (req, res) => {\r\n  const { username, password } = req.body;\r\n  const token = await authService.authenticate(username, password);\r\n  res.json({ token });\r\n});\r\n```\r\n\r\n\r\n```sql\r\n-- Consulta para obtener usuarios activos\r\nSELECT id, username, email\r\nFROM users\r\nWHERE active = true;\r\n```', '', 1, '2025-06-16 19:59:03'),
